import React from "react";
import {NavLink} from "react-router-dom";

const Navbar = () => {
	return (
		<div>
			<NavLink to="/Add_Workouts">Add Workouts</NavLink>
			<NavLink to="/Profile">My Profile</NavLink>
		</div>
	);
};

export default Navbar;
